import styled from 'styled-components';

const Container = styled.div`
    .flex;
    .justify-between;
    .px-12;
    .py-4;
`;
const LogoContainer = styled.div``
const Logo = styled.img`
    height: 50px;
`;

const Header = () => {
    return (
        <Container>
            <LogoContainer>
                <Logo src="/logo.png"  alt="Vilva Athiban P B, The JS Jockey" />
            </LogoContainer>

        </Container>
    )
}

export default Header;
